$(function () {
  var canvas=$('canvas').get(0),
  ctx=canvas.getContext('2d'),
  canWidth=canvas.width=canvas.height=600,
  block=canWidth/15,
  off=block/2+0.5,
  blank=canWidth-block+0.5,
  dict={},
  setp=1;
  flag=true;
  var r=function (deg) {
    return (Math.PI/180)*deg;
  }
  //画背景
  var render=function () {
    var img=new Image;
    img.src='data:image/jpg;base64,';
    img.onload=function(){
      var bjt=ctx.createPattern(img,'repeat');
      ctx.fillStyle=bjt;
      ctx.fillRect(0,0,600,600);
      //画棋盘
      ctx.save();
      ctx.beginPath();
      ctx.translate(off,off);
      for(var i=0;i<16;i++){
        ctx.moveTo(-(i*block),0);
        ctx.lineTo(blank-(i*block),0);
        ctx.moveTo(0,-(i*block));
        ctx.lineTo(0,blank-(i*block));
        ctx.translate(block,block);
      }
      ctx.shadowOffsetX=0;
      ctx.shadowOffsetY=1;
      ctx.shadowBlur=1;
      ctx.shadowColor='#f1d1a3';
      ctx.stroke();
      ctx.closePath();
      ctx.restore();

      var dian=[
        {X:3.5,Y:3.5},
        {X:7.5,Y:7.5},
        {X:11.5,Y:11.5},
        {X:3.5,Y:11.5},
        {X:11.5,Y:3.5}
      ];
      $.each(dian,function (i,v) {
        ctx.save();
        ctx.beginPath();
        ctx.translate(v.X*block,v.Y*block);
        ctx.arc(0,0,5,0,r(360));
        ctx.fillStyle='#000';
        ctx.fill();
        ctx.closePath();
        ctx.restore();
      })
    }
  }
  render();

  //画棋子
  var draw=function (qizi) {
    var
    x=qizi.x,
    y=qizi.y;
    ctx.save();
    ctx.beginPath();
    ctx.translate(x*block+off,y*block+off);
    var black=new Image();
    black.src='data:image/png;base64,';
      black.onload=function () {
        if(qizi.color===1){
          ctx.drawImage(black,28,22,63,64,x*block+off-18,y*block+off-18,36,36);
        }else{
          ctx.drawImage(black,100,22,63,64,x*block+off-18,y*block+off-18,36,36);
       }
    }
    ctx.closePath();
    ctx.restore();
  }
 //判断输赢函数
  var panduan=function (qizi) {
    var date={},h=s=xs=xx=1,y=qizi.y,x=qizi.x,tx,ty;
    $.each(dict,function (k,v) {
      if(v.color==qizi.color){
        date[k]=true;
      }
    })
    ty=y+1;
    while(date[x+'-'+ty]){
      h++;ty++;
    }
    ty=y-1;
    while(date[x+'-'+ty]){
      h++;ty--;
    }
    tx=x+1;
    while(date[tx+'-'+y]){
      s++;tx++;
    }
    tx=x-1;
    while(date[tx+'-'+y]){
      s++;tx--;
    }
    tx=x+1;ty=y+1;
    while(date[tx+'-'+ty]){
      xs++;tx++;ty++;
    }
    tx=x-1; ty=y-1;
    while(date[tx+'-'+ty]){
      xs++;tx--;ty--;
    }
    tx=x+1;ty=y-1;
    while(date[tx+'-'+ty]){
      xx++;tx++;ty--;
    }
    tx=x-1; ty=y+1;
    while(date[tx+'-'+ty]){
      xx++;tx--;ty++;
    }
    if(h>=5||s>=5||xs>=5||xx>=5){
      return true;
    }
  }
  //鼠标点击函数
  var canvasClick=function (e) {
    var x=Math.floor(e.offsetX/block);
    var y=Math.floor(e.offsetY/block);
    if(dict[x+'-'+y]){return};
    var qizi;
    if(flag){
      qizi={x:x,y:y,color:1,setp:setp++};
      dict[x+'-'+y]=qizi;
      draw(qizi);
      if(panduan(qizi)){
        $(this).off('click',canvasClick);
        $('.content').addClass('active');
        $('.win').text('黑棋赢');
        return;
      }
    }else{
      qizi={x:x,y:y,color:0,setp:setp++};
      dict[x+'-'+y]=qizi;
      draw(qizi);
      if(panduan(qizi)){
        $(this).off('click',canvasClick);
        $('.content').addClass('active');
        $('.win').text('白棋赢');
        return;
      }
    }
    flag=!flag;
  }
  $('#canvas').on('click',canvasClick);
 //重新开始游戏
  $('.new-game').on('click',function () {
    $('.content').removeClass('active');
    canWidth=canvas.width=canvas.height=600;
    dict={};
    flag=true;
    setp=1;
    $('#canvas').on('click',canvasClick);
    render();
  })
  //生成棋谱
  $('.qipu').on('click',function () {
    $('.content').removeClass('active');
    $.each(dict,function (i,v) {
       ctx.save();
       ctx.beginPath();
       ctx.translate(v.x*block+off,v.y*block+off);
       ctx.font='20px sans-serif';
       ctx.textAlign='center';
       ctx.textBaseline='middle';
       ctx.fillStyle='rgb(238, 136, 29)';
       ctx.fillText(v.setp,0,0);
       ctx.closePath();
       ctx.restore();
    });
    $('.saveqipu').addClass('active');
  })
  //保存棋谱
  $('.save').on('click',function () {
    var dataURL = canvas.toDataURL("img/png",1);
     $(this).attr('href',dataURL);
     $(this).attr('download','qipu.png')
  })
  //重新开始
  $('.res').on('click',function () {
    $('.saveqipu').removeClass('active');
    canWidth=canvas.width=canvas.height=600;
    dict={};
    flag=true;
    setp=1;
    $('#canvas').on('click',canvasClick);
    render();
  })
})
